import React from 'react';
import icon from '../../assets/pix-icon.svg';

interface IProps{
  // sidePanelToogleClickHandler: ()=>void,
  toggleSidePanel: () => boolean
}

interface IState{
  isSidePanelOpen: boolean
}

export default class PiXIcon extends React.Component<IProps,IState>{
  constructor(props: any){
    super(props);
    this.state = {
      isSidePanelOpen: false
    }
    this.sidePanelToogleClickHandler = this.sidePanelToogleClickHandler.bind(this);
  }

  sidePanelToogleClickHandler(){
    this.setState((prevState:any) => ({
      isSidePanelOpen: !prevState.isSidePanelOpen
    }));
    this.updateNavbar();
  }

  updateNavbar(){
    console.log(this.state.isSidePanelOpen);
    let sidePanelState = this.state.isSidePanelOpen;
    this.props.toggleSidePanel(sidePanelStat);
  }

  render(){
    return(
      <div className="PiXIcon-Component">
        <img className="PiX-Icon" src={icon} onClick={this.sidePanelToogleClickHandler} alt="icon"/>
      </div>
    );
  }

}
